import './App.css';
import React from "react";
import About from './pages/About';
import Home from './pages/Home';
import Blogs from './pages/Blogs';
import { NavBar } from 'lmw-gui-components';
import { getDocs, getFirestore, collection } from 'firebase/firestore'

import { useEffect, useState } from "react";


import {
  BrowserRouter as Router,
  Switch,
  Route,
} from "react-router-dom";
import { AboutProvider } from './context/AboutContext';

const routeData = [
  {
    title: "Home",
    path: "/"
  },
  {
    title: "About",
    path: "/about"
  },
  {
    title: "Blogs",
    path: "/blogs"
  }
]



export default function App() {

  useEffect(() => { 
    const getAboutName = async () => {
      const aboutTitle = await getDocs(collection(getFirestore(), 'about'));
      console.log("aboutTitle", aboutTitle?.docs.map((o) => {
        console.log(o.data().organizationName)

      }))
    };
    getAboutName();
      // console.log(getAboutName);


  }, []);

  return (
    <>
      <AboutProvider>
        <Router>
          <NavBar name="Lauren Wright" links={routeData} />
          <Switch>
            <Route path="/" exact component={Home}>
            </Route>
            <Route path="/about" component={About}>
            </Route>
            <Route path="/blogs" component={Blogs}>
            </Route>
          </Switch>
        </Router>
      </AboutProvider>
    </>
  );
}
